extern crate serde;
#[macro_use] extern crate serde_derive;
extern crate avvy;
extern crate smallvec;

use serde::de::Deserialize;

pub const SCHEMA_STR: &'static str = r###"{
      "type": "record",
      "name": "ut",
      "namespace": "vnoportal",
      "fields": [
        {
          "name": "timestamp",
          "type": [
            "long",
            "int",
            "float",
            "double",
            {
              "type": "fixed",
              "name": "uint64_t",
              "size": 8
            },
            {
              "type": "fixed",
              "name": "int64_t",
              "size": 8
            }
          ]
        },
        {
          "name": "metric",
          "type": "string"
        },
        {
          "name": "value",
          "type": [
            "long",
            "int",
            "float",
            "double",
            {
              "type": "fixed",
              "name": "uint8_t",
              "size": 1
            },
            {
              "type": "fixed",
              "name": "uint16_t",
              "size": 2
            },
            {
              "type": "fixed",
              "name": "uint32_t",
              "size": 4
            },
            "uint64_t",
            {
              "type": "fixed",
              "name": "int8_t",
              "size": 1
            },
            {
              "type": "fixed",
              "name": "int16_t",
              "size": 2
            },
            {
              "type": "fixed",
              "name": "int32_t",
              "size": 4
            },
            "int64_t"
          ]
        },
        {
          "name": "tags",
          "type": [
            "null",
            {
              "type": "map",
              "values": "string"
            }
          ]
        },
        {
          "name": "metadata",
          "type": [
            "null",
            {
              "type": "map",
              "values": "string"
            }
          ]
        }
      ]
    }"###;

#[derive(Deserialize,Debug)]
pub struct UT<'a> {
    timestamp: Timestamp,
    pub metric: String,
    value: Value,
    #[serde(borrow)]
//    tags: Option<Vec<(&'a [u8], &'a [u8])>>,
//    tags: [Option<(&'a [u8], &'a [u8])>; 20],
    tags: Option<smallvec::SmallVec<[(&'a [u8], &'a [u8]); 20]>>,
    #[serde(borrow)]
    metadata: Option<smallvec::SmallVec<[(&'a [u8], &'a [u8]); 20]>>
}

#[derive(Deserialize,Debug)]
enum Timestamp {
    Long(i64),
    Int(i32),
    Float(f32),
    Double(f64)
}

#[derive(Deserialize,Debug)]
enum Value {
    Long(i64),
    Int(i32),
    Float(f32),
    Double(f64),
    Long8(u8),
    Long16(u16),
    Long32(u32),
    Long64(u64),
    I8(i8),
    I16(i16),
    I32(i32),
    Int64(i64)
}

#[test]
fn run_through_test_data() {
    let tests = test_data();
    let schema = avvy::Schema::from_str(SCHEMA_STR).unwrap();


    for test in tests {
        let buf = &test[..];

        let mut de = avvy::AvroDeserializer{buf, schema: &schema, current_field_index: None  };
        de.skip(5);
        UT::deserialize(&mut de).unwrap();
    }
}

